import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);

const header = () => {
    return <div>
        <title>hello</title>
    </div>
}

header();
